import React from "react";
import { Button, Input } from "reactstrap";
import { useMainBox } from "../contexts/MainBoxContext";
import ScreenType from "../enuns/ScreenType";
import './../assets/scss/welcome.scss';

const Welcome: React.FC = () => {
  const { setScreen } = useMainBox();
  return (
    <div className={"main"}>

      <img 
        style={{
          backgroundSize: 'contain',
          background: 'no-repeat',
          width:'45%',
          height: 'auto',
        }}
        src={require('./../assets/images/negocio.png')}
        alt={"decisions"}
      />
      
      <div className={"form shadow bg-white rounded"}>
        
        <div className={"inputs"}>
        
          <h1>Entre já!</h1>
        
          <h6 style={{
            fontSize: 14, 
            marginTop: 10, 
            marginBottom: 10
          }} 
          className="text-muted">E conheça a plataforma de compras mais utilizada do Brasil</h6>
          
          <Input style={{}} placeholder="E-mail"></Input>

          <Input style={{marginTop: 10}} placeholder="Senha"></Input>
        
        </div>

        <div style={{
          marginTop: 20,
        }} 
        className={"buttons"}>
          <Button color={"primary"} style={{
            width: "100%"
          }}
          onClick={() => setScreen(ScreenType.MINHASCOTACOES)}>
            Entrar
          </Button>
          <Button style={{
            float: "left",
            fontSize: 14,
          }}
            color={"link"}>
            Cadastre-se
          </Button>
          <Button style={{
            float: "right",
            fontSize: 14  
          }}
            color={"link"}>
            Esqueceu a sua senha?
          </Button>
        </div>
      </div>
    </div>
  );
};

export default Welcome;
